import React from 'react';
import Gallery from 'react-photo-gallery';
import 'tailwindcss/tailwind.css'; // Ensure Tailwind CSS is imported

const photos = [
    { src: './assets/logo.png', width: 4, height: 3, alt: 'Edited photograph' },
    { src: './assets/927 Belle Oaks-10.jpg', width: 4, height: 3, alt: 'Property at 927 Belle Oaks' },
    { src: './assets/Paris Paul Cezanne-22.jpg', width: 4, height: 3, alt: 'Related to Paul Cezanne' },
    // Add more images as needed
];

function PhotoGallery() {
    return (
        <div className="p-5">
            <Gallery photos={photos} />
        </div>
    );
}

export default PhotoGallery;
